import sympy as sym
import numpy as np

def integrate(f, xt, dt):
    """
    This function takes in an initial condition x(t) and a timestep dt,
    as well as a dynamical system f(x) that outputs a vector of the
    same dimension as x(t). It outputs a vector x(t+dt) at the future
    time step.

    Parameters
    ============
    dyn: Python function
        derivate of the system at a given step x(t),
        it can considered as \dot{x}(t) = func(x(t))
    xt: NumPy array
        current step x(t)
    dt:
        step size for integration

    Return
    ============
    new_xt:
        value of x(t+dt) integrated from x(t)
    """
    k1 = dt * f(xt)
    k2 = dt * f(xt+k1/2.)
    k3 = dt * f(xt+k2/2.)
    k4 = dt * f(xt+k3)
    new_xt = xt + (1/6.) * (k1+2.0*k2+2.0*k3+k4)
    return new_xt

def simulate(f, x0, tspan, dt, integrate):
    """
    This function takes in an initial condition x0, a timestep dt,
    a time span tspan consisting of a list [min_time, max_time],
    as well as a dynamical system f(x) that outputs a vector of the
    same dimension as x0. It outputs a full trajectory simulated
    over the time span of dimensions (xvec_size, time_vec_size).

    Parameters
    ============
    f: Python function
        derivate of the system at a given step x(t),
        it can considered as \dot{x}(t) = func(x(t))
    x0: NumPy array
        initial conditions
    tspan: Python list
        tspan = [min_time, max_time], it defines the start and end
        time of simulation
    dt:
        time step for numerical integration
    integrate: Python function
        numerical integration method used in this simulation

    Return
    ============
    x_traj:
        simulated trajectory of x(t) from t=0 to tf
    """
    N = int((max(tspan)-min(tspan))/dt)
    x = np.copy(x0)
    tvec = np.linspace(min(tspan),max(tspan),N)
    xtraj = np.zeros((len(x0),N))
    for i in range(N):
        xtraj[:,i]=integrate(f,x,dt)
        x = np.copy(xtraj[:,i])
    return xtraj

m1, m2, R1, R2, g, t = sym.symbols('m_1, m_2, R_1, R_2, g, t')

m1 = 1
m2 = 1
R1 = 1
R2 = 1
g = 9.8

theta1 = sym.Function(r'\theta_1')(t)
theta1dot = theta1.diff(t)
theta1ddot = theta1dot.diff(t)
theta2 = sym.Function(r'\theta_2')(t)
theta2dot = theta2.diff(t)
theta2ddot = theta2dot.diff(t)

q = sym.Matrix([theta1, theta2])
qdot = q.diff(t)
qddot = qdot.diff(t)

rotation1 = sym.Matrix([[sym.cos(theta1), -sym.sin(theta1), 0],
            [sym.sin(theta1), sym.cos(theta1), 0],
             [0, 0, 1]])

translation1 = sym.Matrix([[1,0,0],
                           [0,1,-R1],
                           [0,0,1]])

rotation2 = sym.Matrix([[sym.cos(theta2), -sym.sin(theta2), 0],
            [sym.sin(theta2), sym.cos(theta2), 0],
             [0, 0, 1]])

translation2 = sym.Matrix([[1,0,0],
                           [0,1,-R1],
                           [0,0,1]])


origin = sym.Matrix([0, 0, 1])

coordinates1 = (rotation1*translation1)*origin
coordinates2 = (rotation1*translation1*rotation2*translation2)*origin

x1 = coordinates1[0]
y1 = coordinates1[1]
x2 = coordinates2[0]
y2 = coordinates2[1]

v1 = (x1.diff(t))**2 + (y1.diff(t))**2
v2 = (x2.diff(t))**2 + (y2.diff(t))**2

KE = 0.5*m1*v1 + 0.5*m2*v2
PE = m1*g*y1 + m2*g*y2
L = sym.Matrix([KE - PE])

dLdq = L.jacobian(q)
dLdqdot = L.jacobian(qdot)
dLdqdotdt = dLdqdot.diff(t)
euler = sym.Eq(dLdqdotdt, dLdq)
display(euler)

soln = sym.solve(euler, qddot)

theta1_func = sym.lambdify((theta1, theta2, theta1dot,theta2dot), soln[theta1ddot])
theta2_func = sym.lambdify((theta1, theta2, theta1dot,theta2dot), soln[theta2ddot])

def func(s):
  return np.array([s[2], s[3], theta1_func(*s), theta2_func(*s)])

s0 = np.array([-np.pi/3, -np.pi/3, 0.0, 0.0])
traj = simulate(func, s0, [0, 3], 0.01, integrate)
time = np.linspace(0, 3, len(traj[0]))

